import React, { useState } from "react";
import useSwr from "swr";

const whore = setInterval(StopsApiCall, 1000);

function StopsApiCall() {
  // This code will be used when the api calls are possible
  const fetcher = (...args) =>
    fetch(...args).then((response) => response.json());

  const url =
    "https://data.smartdublin.ie/cgi-bin/rtpi/busstopinformation?operator=bac";

  const { data, error } = useSwr(url, { fetcher });

  console.log(data.results);
  const stopData = data.results && !error ? data.results.slice(0, 5000) : [];
  console.log(stopData);
}

export default whore;
